DROP TABLE IF EXISTS `counter`;
CREATE TABLE `counter`
(
    `id`          bigint                                                       NOT NULL AUTO_INCREMENT COMMENT '交易编号',
    `num`         int                                                          NULL DEFAULT NULL COMMENT '交易单位量',
    `fee`         float                                                        NULL DEFAULT NULL COMMENT '手续费',
    `trade_type`  int                                                          NULL DEFAULT NULL COMMENT '交易类型',
